import React from "react";
import {Link} from "react-router-dom";

function Options(props){
    return(
        <div className="options-container">
            <button className="options"><Link >
                <i className="fa fa-file-text-o" style={{fontSize:"25px", padding: "0px" ,border: "none"}}></i><span style={{color:"white"}}>Documents</span>
            </Link></button>
        </div>
    );
}

export default Options;
